import LogType from './LogType';
/**
 * @internal
 */
interface ILogEntry {
    /**
     * The name of the module associated with this entry
     */
    moduleName: string;
    /**
     * The feature associated with this entry
     */
    logFeature: string;
    /**
     * The log type
     */
    logType: LogType;
    /**
     * The optional property bag
     */
    logProperties?: {
        [key: string]: string;
    };
    /**
     * serializes the entry
     */
    toString(): string;
}
export default ILogEntry;
